import React from 'react';
import Router from './components/Router/RouterContainer';
import store from './store/index';

import { Provider } from 'react-redux';


const App = () => (
  <section className={section-main}>
    <Provider store={store}>
      <Router></Router>
    </Provider>
  </section>
);

export default App;
